//------------------------------------------------------
// The Dot Factory v.0.1.4 settings:
// Flip/ Rotate: No, No
// Padding Removal: Fixed, Fixed
// Line wrap: At bitmap (or At column, it doesn't matter in general)
// Generate descriptor lookup array: Yes, but only to know char width and height in bits
// Byte:
// Bit layout: RowMajor
// Order: LSBFirst
// Format: Hex
// Leading: 0x
//------------------------------------------------------
// Then generate and copy bitmap array from The Dot Factory to your code
// adding 4 bytes before:
// 1. the char width in bits
// 2. the char height in bits
// 3. the first char (inclusive)
// 4. the last char (inclusive)
//------------------------------------------------------
// Also it's possible to use font bitmap arrays from uGUI library
// adding 4 bytes before (see above).
